import React from 'react';
import styled from 'styled-components';

const HomeSection = styled.section`
  height: 100vh;
  display: flex;
  justify-content: center;
  align-items: center;
  background-color: #282c34;
  color: white;
  text-align: center;
`;

export const Home = () => {
  return (
    <HomeSection>
      <div>
        <h1>Tanishq Jain</h1>
        <p>DevOps Engineer</p>
      </div>
    </HomeSection>
  );
};
